import axios from 'axios';

// export function RetriveHelloWorld(){
//     return axios.get('http://localhost:8080/hello-world-bean')
// }

const ApiClient = axios.create({baseURL:'http://localhost:8080/'})


export const RetriveHelloWorld = ()=> axios.get('hello-world-bean')

export const RetriveHelloWorldUser = (UserName)=>  axios.get(`http://localhost:8080/hello-world/pathvar/${UserName}`)
